import React, { Component } from 'react';
//import logo from './logo.svg';
import './App.css';

//import { BrowserRouter } from 'react-router-dom'
import Button from './Component/Button';


class App extends Component {
  render() {
    return (
      <div className="App">
       <div className="row">
               <div className="col-3">
                   <Buttons page={P1} getColorFun={this.getColor}></Buttons>
               </div> 
               <div className="col-3">
                   <Buttons page={P2} getColorFun={this.getColor}></Buttons>
               </div>   
               <div className="col-3">
                   <Buttons page={P3} getColorFun={this.getColor}></Buttons>
               </div>   
               <div className="col-3">
                   <Buttons page={P4} getColorFun={this.getColor}></Buttons>
               </div>       
       })}
       </div>
       {/* <div className="row">
       {this.print()}
       </div> */}
     </div>
   )
  }
}

export default App;
